import React from 'react';
import './ContractDetails.css';

const ContractDetails = ({ contract }) => {
  return (
    <div className="contract-details">
      <h2>Contract Details</h2>
      <div className="info">
        <span><strong>Bid No:</strong> {contract.bid_no}</span>
        <span><strong>Client Name:</strong> {contract.clientName}</span>
        <span><strong>Place:</strong> {contract.place}</span>
      </div>
    </div>
  );
};

export default ContractDetails;
